#include <stdio.h>

int maxConsecutiveAnswers(char * answerKey, int k){
    char * p_t,*s_t,*p_f,*s_f;
    p_t = answerKey;
    s_t = answerKey;
    p_f = answerKey;
    s_f = answerKey;
    int total_t = 0;
    int total_f = 0;
    int max = 0;
    int rem_f = k;
    int rem_t = k;
    while(*s_t || *s_f){
        //printf("%c\n",*p);
        if(*s_f){
            if(*p_f == 'T'){
                total_f++; 
            }
            else if(*p_f == 'F'){
                total_f++;
                rem_f--;
            }
            if(rem_f == -1 || !*(p_f+1)){
                if (rem_f == -1) {
                    total_f--;
                }
                //printf("end\n");
                max = total_f > max ? total_f : max;
                total_f = 0;
                s_f++;
                while(*s_f != 'F' && *s_f){
                    total_f++;
                    s_f++;
                }
                p_f = s_f;
                rem_f = k;
            }
            else{
                p_f++;
            }
        }
        if(*s_t){
            if(*p_t == 'T'){
                total_t++; 
            }
            else if(*p_t == 'F'){
                total_t++;
                rem_t--;
            }
            if(rem_t == -1 || !*(p_t+1)){
                if (rem_t == -1) {
                    total_t--;
                }
                //printf("end\n");
                max = total_t > max ? total_t : max;
                total_t = 0;
                s_t++;
                while(*s_t != 'T' && *s_t){
                    total_t++;
                    s_t++;
                }
                p_t = s_t;
                rem_t = k;
            }
            else{
                p_t++;
            }
        }
    
    }
    //printf("max of T | F = %i\n",max);
    return max;
}

int main(){
    char * answerKey = "TTFTTFTT";
    int k = 1;
    answerKey="";
    k = 1675;
    int r = maxConsecutiveAnswers(answerKey, k);
    printf("%i\n",r);
}
